import React from 'react'
import { connect } from 'react-redux'
import { Link, Route, BrowserRouter as Router } from 'react-router-dom'
import { staticAdminUrl } from '../config'
import { LogoutButton } from '../public_component/index'

const Signup = () => {
    return(
        <h1>sign up here</h1>
    )
}

const AdminDashboard  = ({auth}) => {

    return(
        <div className="wrap">
            <div className="info">
                <LogoutButton />
                <img  src={staticAdminUrl+"admin.jpg"}  alt="avatar" />
                <h1>Admin DashBoard</h1>
                <h2>{ auth.username }</h2>
                <h2>{ auth.level }</h2>
                <Link to="/">TO HOMEPAGE</Link>            
            </div>

            <div className="sidebar">
                <ul>
                    <li><Link to="/admin_dashboard/addAdmin">Add administator</Link></li>
                </ul>
            </div>

            <Route path="/admin_dashboard/addAdmin"  component={Signup}/>
        </div>
    )
}

const mapStateToProps = state => ({
    auth: state.auth
})

export default connect(mapStateToProps)(AdminDashboard);
